import React, { Component } from 'react';
import axios from 'axios';



const list = [
  {
    "id":1,
    "title":"1st todo",
    "body":"Learn Django properly."
    },
    {
    "id":2,
    "title":"Second item",
    "body":"Learn Python."
    },
    {
    "id":3,
    "title":"Learn HTTP",
    "body":"It's important."
    }

]




class App extends Component {

  constructor(props) {
    super(props);
    this.state = { list };
  }

  render() {
    return(
      <div>
        {this.state.list.map(item => (
          <div key={item.id}>
            <h1>{item.title}</h1>
            <p>{item.body}</p>
          </div>
        ))}
      </div>
    )

    }



}



export default App;
